<p><code>希尔排序</code>（英语：Shell sort），也称为缩小增量排序法，是 <a href="/leslie-blog/algorithms/sort/insertion-sort.html" target="_blank">插入排序</a> 的一种改进版本。希尔排序以它的发明者希尔（英语：Donald Shell）命名。</p>
